impl Solution {
    pub fn max_subarray_length(nums: Vec<i32>, k: i32) -> i32 {
        use std::collections::HashMap;

        let mut map = HashMap::new();
        let (mut start, mut end, mut max_len, mut count) = (0, 0, 0, 0);

        while end < nums.len() {
            *map.entry(nums[end]).or_insert(0) += 1;
            if *map.get(&nums[end]).unwrap() <= k {
                max_len = max_len.max(end - start + 1);
            } else {
                while *map.get(&nums[end]).unwrap() > k {
                    *map.get_mut(&nums[start]).unwrap() -= 1;
                    if *map.get(&nums[start]).unwrap() == 0 {
                        map.remove(&nums[start]);
                    }
                    start += 1;
                }
            }
            end += 1;
        }
        max_len as i32
    }
}
